  false,\n\t\"url\": null,\n\t\"notes\": \"The fishery genetics tissue collection
  has over 80,000 tissues stored in 95% ethanol representing fishes and invertebrates
  collected globally but with a focus on the North Pacific.  These samples are focused
  on sharks (primarily blue, mako and common thresher), groundfish (primarily Sebastes
  spp.), and highly migratory species (tunas, billfish, yellowtail, opah) but also
  contain assorted other samples including parasites from some animals, eggs and larvae,
  and abalone (primarily pink abalone).\",\n\t\"license_title\": null,\n\t\"extras\":
